con:soapui-project.con:afterLoadScript:
/*** setting up setup and tear down from external files setup.txt and teardown.txt are files. if the files are in soapui bin folder then we can pass the filenaame directly else we need to pass the whole path to teh file. */
def su = new File("setup.txt").text def td = new File("teardown.txt").text
project.getTestSuiteList(). each { testSuite -> testSuite.getTestCaseList().each { testCase -> testCase.setSetupScript(su) testCase.setTearDownScript(td) }
}
